import React from 'react'
import {Container,Box,Text} from "@chakra-ui/react"

const HomePage = () => {
  return (
    <Container maxW='xl' centerContent>
      <Box
      d = "flex"
      justifyContent="center"
      padding={3}
      bg = {white}
      >
        <Text>Talk Bot</Text>
      </Box>
      
    </Container>
  )
}

export default HomePage;
